getDefinition.!description:
Gets current value of property {@link #getDefinition definition}.

A valid XML fragment that contains an &lt;svg&gt; element that complies with the following requirements: <ul> <li>It includes no SVG groups (&lt;g&gt; elements).</li> <li>It includes no &lt;defs&gt; elements.</li> </ul> The SVG element is transformed into a status indicator shape in the following way: <ul> <li>The <code>viewBox</code> attribute of the root SVG element is respected and kept after the transformation.</li> <li>The inline styles of SVG shapes are respected, and shapes with such inline styles are not considered to be fillable.</li> <li>The SVG shapes without classes are considered fillable.</li> <li>If there are multiple fillable shapes, each shape element must have a <code>data-shape-id</code> attribute that is set to a unique value.</li> </ul> Example: <pre>
  &lt;svg version=&quot;1.1&quot; xmlns=&quot;http://www.w3.org/2000/svg&quot; xmlns:xlink=&quot;http://www.w3.org/1999/xlink&quot; viewBox=&quot;0 0 30 30&quot; xml:space=&quot;preserve&quot;&gt;
     &lt;path style=&quot;fill:blue;&quot; d=&quot;M14.664,29....&quot; /&gt;
     &lt;path style=&quot;fill:blue;&quot; d=&quot;M13.626,25....&quot; /&gt;
     &lt;path data-shape-id=&quot;fill-1&quot; d=&quot;M15.337,21....&quot; /&gt;
     &lt;path data-shape-id=&quot;fill-2&quot; d=&quot;M13.626,17....&quot; /&gt;
     &lt;path data-shape-id=&quot;fill-3&quot; d=&quot;M15.337,14....&quot; /&gt;
     &lt;path data-shape-id=&quot;fill-4&quot; d=&quot;M13.107,10....&quot; /&gt;
  &lt;/svg&gt;
</pre> The first two paths in this example are filled with blue color. The last four shape elements are filled gradually, as the status indicator's value changes.

Please note that the SVG element must be escaped when used directly as an attribute in the XML view.

